# day 5, part 2
# now find the most offending character
# strip out each letter of alphabet one-at-a-time
# reduce the polymer and note the length
# output is the least of all the lengths

import string
def getReducedPolymerLength( p ):
  i = 0
  while True:
    # if cur is same letter as next and cur case XOR next case ...
    if (p[i].lower() == p[i+1].lower()) and (p[i].isupper() != p[i+1].isupper()):
      # remove the two chars
      if i+3 > len(p):
        p = p[:i]
      else:
        p = p[:i] + p[i+2:]

      # now step back to prev
      i -= 1
      if i < 0:
        i = 0
    else:
      # advance to next
      i += 1
      if i > len(p) - 3:
        # we're done
        return len(p)

# input polymer
p = ''
#'
#p = 'dabAcCaCBAcCcaDA' # sample input

min_len = len(p) 
letters = 'abcdefghijklmnopqrstuvwxyz'
for i in letters:
  # strip out all of letter i from p
  letter = i + i.upper()
  cur = p.translate(string.maketrans('', ''), letter)

  # if a strip occured, get the reduced length
  if len(cur) != len(p):
    result = getReducedPolymerLength( cur )
    print( letter, result )

    # if its the lowest seen len, save it
    if result < min_len:
      min_len = result

print( min_len )

